import React from "react";

class MovieCard extends React.Component{
    render(){
        const {movie} = this.props; 
        return(
            <div className="movie-card">
            <div className="left">
                <img alt="movie-poster" src={movie.poster}></img>
            </div>
            <div className="right"></div>
            

         </div>
        );
    }
}
export default MovieCard;
